// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract RemoteDesktop {
    struct User {
        address publicKey;
        bool isActive;
    }

    mapping(address => User) public users;
    uint256 public sessionCount;

    event UserRegistered(address indexed user);
    event SessionStarted(uint256 sessionId, address user, uint256 startTime);

    function registerUser() public {
        require(users[msg.sender].isActive == false, "User already registered");
        users[msg.sender] = User(msg.sender, true);
        emit UserRegistered(msg.sender);
    }

    function startSession() public {
        require(users[msg.sender].isActive, "User not registered or inactive");
        sessionCount++;
        emit SessionStarted(sessionCount, msg.sender, block.timestamp);
    }
}
